import Calendar from 'react-calendar';
import { useState } from 'react';
import React from 'react';
import 'react-calendar/dist/Calendar.css';
import './App.css';
function useToggle(initialValue = false) {
    const [value, setValue] = React.useState(initialValue);
    const toggle = React.useCallback(() => {
        setValue(v => !v);
    }, []);
    return [value, toggle];
}


function foobar(){
    if (true) {
        return 'tileDisabled={({ date }) => date.getMonth && date.getDay() == 0 || date.getDay() == 6}}';
    }
}
function App() {
    const [value, onChange] = useState(new Date());
    const [isOn, toggleIsOn] = useToggle();

    const data = ["tileDisabled={({ date }) => date.getMonth && date.getDay() == 0 || date.getDay() == 6}"]

    return (
        <div className="App">
            <div className='intro'>
                <div className='intro-left'>
                    <div class="login-form">
                        <h1>Create Event</h1>
                        {data.map((d, id) => {
                            return <ToggleItem id={id} discription={d} />;
                        })}
                        <div class='calender-table'>
                            <Calendar
                                onChange={onChange}
                                value={value}
                                calendarType={"US"}
                                selectRange={true}
                                tileDisabled = {isOn ? "thing": "not thing"}
                                minDetail={"month"}
                                />
                        </div>
                    </div>
                </div>
                <div className='intro-right'>
                    <h2>TODO: Other bs</h2>
                </div>
            </div>
        </div>
    );
}

export default App;
